import React from "react";
import styled from "styled-components";

const Wrapper = styled.section``;

function Search() {
  return (
    <Wrapper>
      <div className="container">
        <div className="left">
          <div className="title"></div>
          <button>문의글 작성</button>
        </div>
      </div>
    </Wrapper>
  );
}

export default Search;
